import React, { Component } from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';

import "../App.css"

class NavigationBar extends Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div className="navBar">
        <Navbar color="light fixed-top" light expand="md">
          <NavbarBrand href="/"><img src={require(`../assets/logo adirasa.png`)} height="90px" alt="Card image cap" /> Adirasa Snack</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
            <NavItem>
              <NavLink href="#"><p className="text-info"><img src={require(`../assets/candy.png`)} height="25px" alt="Card image cap" />  Snack Tadisional</p></NavLink>
            </NavItem>
              <NavItem>
                <NavLink href="#"><p className="text-danger"> <img src={require(`../assets/chips.png`)} height="25px" alt="Card image cap" /> Keripik</p></NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#"><p className="text-warning"><img src={require(`../assets/peanuts.png`)} height="25px" alt="Card image cap" /> Kacang </p></NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#"><p className="text-primary"><img src={require(`../assets/login-square-arrow-button-outline.png`)} height="25px" alt="Card image cap" />  Login</p></NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#"><p className="text-muted"><img src={require(`../assets/shopping-bag.png`)} height="25px" alt="Card image cap" /> Cart </p></NavLink>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    );
  }
}

export default NavigationBar;
